import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

// Skills pool
const skills = [
  "Full Stack Developer",
  "Java Developer",
  "React Developer",
  "UI/UX Designer",
  "Mobile App Developer",
  "Data Scientist",
  "Digital Marketer",
  "Content Writer",
  "Graphic Designer",
  "DevOps Engineer"
];

// Realistic names
const names = [
  "John Doe", "Sarah Smith", "David Lee", "Priya Sharma",
  "Michael Chen", "Aisha Khan", "Robert Johnson", "Emma Brown",
  "Olivia Davis", "William Wilson", "Sophia Miller", "James Taylor",
  "Mia Anderson", "Ethan Thomas", "Isabella Martinez", "Alexander Jackson",
  "Charlotte White", "Daniel Harris", "Amelia Clark", "Benjamin Lewis",
  "Harper Young", "Samuel King", "Ella Wright", "Jacob Scott",
  "Liam Green", "Emily Adams", "Noah Baker", "Abigail Nelson",
  "Lucas Carter", "Madison Mitchell", "Henry Perez", "Elizabeth Roberts",
  "Sebastian Turner", "Grace Phillips", "Owen Campbell", "Chloe Parker",
  "Mason Evans", "Victoria Edwards", "Jack Collins", "Scarlett Stewart",
  "Aiden Sanchez", "Lily Morris", "Logan Rogers", "Zoey Reed",
  "Nathan Cook", "Hannah Morgan", "Caleb Bell", "Aria Murphy",
  "Wyatt Bailey", "Nora Rivera", "Leo Cooper", "Stella Richardson",
  "Isaac Cox", "Aurora Howard", "Christian Ward", "Violet Torres",
  "Hunter Peterson", "Savannah Gray", "Jonathan James", "Penelope Hughes"
];

// Generate 60 freelancers
const freelancersData = Array.from({ length: 60 }, (_, i) => ({
  id: i + 1,
  name: names[i], // ‚úÖ This must match the names array
  skill: skills[i % skills.length],
  rating: (4 + Math.random()).toFixed(1),
  price: `$${20 + i}/hr`,
  img: `https://i.pravatar.cc/150?img=${(i % 70) + 1}`
}));

function Freelancers() {
  const navigate = useNavigate();
  const [search, setSearch] = useState("");
  const [skillFilter, setSkillFilter] = useState("");

  const filteredFreelancers = freelancersData.filter(f =>
    f.name.toLowerCase().includes(search.toLowerCase()) &&
    (skillFilter === "" || f.skill === skillFilter)
  );

  const hireFreelancer = (freelancer) => {
    localStorage.setItem("hiredFreelancer", JSON.stringify(freelancer));
    alert(`You hired ${freelancer.name} ‚úÖ`);
    navigate(`/freelancer/${freelancer.id}`);
  };

  return (
    <div style={styles.page}>
      <h1 style={styles.heading}>Browse Freelancers üë©‚Äçüíª</h1>

      <div style={styles.filterBox}>
        <input
          type="text"
          placeholder="Search by name..."
          value={search}
          onChange={(e) => setSearch(e.target.value)}
          style={styles.input}
        />

        <select
          value={skillFilter}
          onChange={(e) => setSkillFilter(e.target.value)}
          style={styles.select}
        >
          <option value="">All Skills</option>
          {skills.map((s, idx) => (
            <option key={idx} value={s}>{s}</option>
          ))}
        </select>
      </div>

      <div style={styles.container}>
        {filteredFreelancers.map(f => (
          <div key={f.id} style={styles.card}>
            <img src={f.img} alt={f.name} style={styles.image} />
            <h3>{f.name}</h3>
            <p>{f.skill}</p>
            <p>‚≠ê {f.rating}</p>
            <p style={styles.price}>{f.price}</p>
            <button style={styles.button} onClick={() => hireFreelancer(f)}>
              Hire Now
            </button>
          </div>
        ))}
      </div>
    </div>
  );
}

const styles = {
  page: { minHeight: "100vh", padding: "40px", background: "linear-gradient(135deg,#1d2671,#c33764)", color: "white", textAlign: "center" },
  heading: { marginBottom: "20px" },
  filterBox: { marginBottom: "25px", display: "flex", justifyContent: "center", gap: "10px", flexWrap: "wrap" },
  input: { padding: "10px", borderRadius: "10px", border: "none", outline: "none", width: "200px" },
  select: { padding: "10px", borderRadius: "10px", border: "none", outline: "none" },
  container: { display: "grid", gridTemplateColumns: "repeat(auto-fit, minmax(220px, 1fr))", gap: "25px" },
  card: { backdropFilter: "blur(15px)", background: "rgba(255,255,255,0.1)", borderRadius: "15px", padding: "20px", boxShadow: "0 8px 32px rgba(0,0,0,0.3)", border: "1px solid rgba(255,255,255,0.2)", transition: "0.3s" },
  image: { width: "90px", height: "90px", borderRadius: "50%", border: "3px solid white", marginBottom: "10px" },
  price: { fontWeight: "bold", margin: "10px 0" },
  button: { padding: "10px 15px", border: "none", borderRadius: "20px", background: "linear-gradient(45deg,#ff416c,#ff4b2b)", color: "white", fontWeight: "bold", cursor: "pointer" }
};

export default Freelancers;
